import React from 'react';
import Navigation from '../components/Navigation';

const Home = () => {
    return (
        <div>
            <Navigation />
            <div className="bg-home">
                <h1>Des formules riches en nutriments pour tous les types de peau.</h1>
                <button></button>
            </div>
        </div>
    );
};

export default Home;
